import './Experience.css'
import Timeline from './components/timeline/Timeline'

function Experience() {
  return (
    <section id='experience' className='sectionBackground'>
      <section className='sectionContents'>
        <Timeline />
      </section>
    </section>
  )
}

export default Experience;
